import React from "react";
import { Alert } from "antd";

const fraudTrades = [];

const errorTrades = ["AGD896", "ADS888"];

const errorTradeMessage = "Trade ID " + errorTrades[0] + " - Error detected.";

class Alertlist extends React.Component {
  render() {
    return (
      <div>
        <Alert message={this.errorTrades} type="warning" showIcon />
        <Alert message="Potential fraudulent trade detected ..." type="error" showIcon />
      </div>
    );
  }
}
export default Alertlist;
